import React, { Component } from 'react'
import Main from '../template/Main'

const headerProps = {
    icon: 'search',
    title: 'Movie',
    subtitle: 'Search Movies by Title'
}

export default class Movie extends Component {
    render(){
        return(
            <Main {...headerProps}>
                Movies
            </Main>
        )
    }
}
